import React from 'react'
import InnerpageHero from './InnerpageHero'
import heroImg from '../images/img03.png'

export default function Cart() {
  return (
    <>
      <InnerpageHero src={heroImg} alt="Cart page Hero" heading="Cart Page" />
    </>
  )
}
